                if (isConfirm) {
                    form.submit();
                } else {
                    swal(""Đã hủy"", ""Bạn đã không lưu những thay đổi này!"", ""error"");
                }
            });
        }
    });

    function checkValidateData() {
        if ($('#PhoneNumber').val() == '') {
            sweetAlert(""Thông báo"", ""Thông tin số điện thoại không được để trống"", ""error"");
